forms.customCss:
#lfb_form.lfb_bootstraped #lfb_mainPanel .lfb_genSlide .lfb_genContent div.lfb_selectable span.icon_select {
    display: none;
}

#lfb_form.lfb_bootstraped #lfb_legalNoticeContent {
    border: 0px;
}

@media only screen and (min-width: 468px) {
#lfb_form.lfb_bootstraped:not([data-usevisual="1"]) #lfb_mainPanel .lfb_genSlide .lfb_genContent .col-md-2 {
    max-width: 50%;
}
}

forms.formStyles:
@import url("https://fonts.googleapis.com/css?family=Raleway");
#lfb_form.lfb_bootstraped[data-form="8"] #finalSlide>H2:nth-child(1) {
   transition: all 0.3s ease-out 0s;
    font-family: Raleway;
}
#lfb_form.lfb_bootstraped[data-form="8"] #lfb_finalLabel {
   font-family: Raleway;
}
#lfb_form.lfb_bootstraped[data-form="8"] #lfb_lfb_finalPrice>SPAN:nth-child(1) {
   color: rgb(48, 48, 48);
    font-family: Raleway;
}
#lfb_form.lfb_bootstraped[data-form="8"] #lfb_btnOrder {
   background-color: rgb(48, 48, 48);
    font-style: normal;
    font-weight: bold;
    text-decoration: none;
    font-family: Raleway;
}
#lfb_form.lfb_bootstraped[data-form="8"] #finalSlide>DIV:nth-child(2)>DIV:nth-child(1)>DIV:nth-child(4)>DIV:nth-child(1)>LABEL:nth-child(1) {
   font-family: Raleway;
}
#lfb_form.lfb_bootstraped[data-form="8"] #finalSlide>DIV:nth-child(2)>DIV:nth-child(1)>DIV:nth-child(5)>DIV:nth-child(1)>LABEL:nth-child(1) {
   font-family: Raleway;
}
#lfb_form.lfb_bootstraped[data-form="8"] #genPrice>DIV:nth-child(1)>DIV:nth-child(1)>DIV:nth-child(1) {
   font-size: 18px;
    background-color: rgb(252, 202, 3);
}

